import React from "react";
import LandingPage from "../components/LandingPage";
import styled from "styled-components";
import { GlobalStyle } from "../css/index";

const index: React.FC = () => {
  const Div = styled.div`
    padding: 50px;
    margin: 20px;
  `;

  return (
    <>
      <GlobalStyle />
      <LandingPage />
    </>
  );
};

export default index;
